const PostLink = props => (
    <li>
      <Link href={`/post?title=${props.title}`}>
        <a>{props.title}</a>
      </Link>
    </li>
  );
const Page = () =>( 
    <div>
        <p>Hello next.js</p>
        <p>Hello next.js</p>
        <p>Hello next.js</p>
    </div>
);
export default Layout(Page);
